    "2016-11-25T21:06:02.622962",nt"name": "national-public-education-financial-survey-200910",nt"isopen":
    true,nt"url": null,nt"notes": "The National Public Education Financial
    Survey, 2009-10 (NPEFS 2009-10), is a study that is part of the Common Core of Data's
    National Public Education Financial Survey program.  Data available since 1987 at
    <http://nces.ed.gov/ccd/stfis.asp>. CCD-NPEFS 2009-10 (http://nces.ed.gov/ccd/stfis.asp)
    is a cross-sectional survey that collected information about revenues and expenditures
    for public elementary and secondary education. The information is drawn from the
    state education agenciesufffd administrative records systems; no additional data
    are collected from schools or districts. NPEFS data are used in calculating statesufffd
    Title I grants. The study was conducted using responding agencies' existing administrative
    records.  The universe of state education agencies was sampled.  The studyufffds
    response rate has not been calculated as of May 2013.  Key statistics produced from
    CCD-NPEFS 2009-10 are on revenues by source and expenditures by function and object.
     Average daily attendance is also collected on the NPEFS.",nt"license_title":
